package basicpro;
import java.util.*;
public class Switch3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc=new Scanner(System.in);
		int n=sc.nextInt();
		switch(n) {
		case 10:
			System.out.println("success");
			break;
		case 20:
			System.out.println("success");
			break;
		case 30:
			System.out.println("success");
			break;
			default:
				System.out.println("value between 10,20 and 30");
		}
	}

}
